import React, { Component } from 'react'
import styled from 'styled-components'
import MainImage from '../../assets/images/main.jpg'
const HomeImage = styled.div`
    width: 100%;
    height: 100%;
    background-image: url('${MainImage}')
`
class Home extends Component {
  render() {
    return (
     <HomeImage/>
    )
  }
}
export default Home
